import React from "react"

class Carouselitem extends React.Component{
  render() {
    return (
        <Carousel.Item interval={2000}>
          <img
            className={this.props.className}
            src={this.props.src}
            alt={this.props.alt}
          />
          <Carousel.Caption>
          </Carousel.Caption>
        </Carousel.Item>
      )
    }
  }
  export default Carouselitem
